import React, {useState} from 'react';
import identityService from './../../services/identity.service';
import {useGetAssociations} from '../../services/association.service';
import {makeStyles} from '@material-ui/core';
import AssociationCard from '../basic/association.card';


function Index() {
    const associations = useGetAssociations();

    return (

        <div className="association-card">
            {associations.map(a => (
                <AssociationCard association={a}/>
            ))}
        </div>

    );
}

export default Index;
